Estas es una función en Python que calcula la sucesión de Fibonacci para un número n dado:

def fibonacci(n):
    if n < 2:
        return n
    else:
        return fibonacci(n-1) + fibonacci(n-2)

Para usar la función, simplemente llama fibonacci(n) donde n es el número de términos de la sucesión de Fibonacci que deseas calcular. La función devuelve el valor del enésimo término de la sucesión. Por ejemplo, fibonacci(6) devuelve 8, que es el valor del sexto término de la sucesión de Fibonacci.

¡Claro! Aquí te dejo una función en Python para encontrar la sucesión de Fibonacci:


def fibonacci(n):
    # Casos base para n = 0 y n = 1
    if n == 0:
        return 0
    elif n == 1:
        return 1
    # Para n > 1, se calcula la sucesión de Fibonacci recursivamente
    else:
        return fibonacci(n-1) + fibonacci(n-2)

Explicación: esta función recibe como entrada un número entero n, que representa el índice de la sucesión de Fibonacci que se desea calcular. Si n es igual a 0 o 1, la función retorna los valores base de la sucesión de Fibonacci. Si n es mayor que 1, la función calcula recursivamente el valor de la sucesión de Fibonacci para n-1 y n-2, y luego los suma para obtener el valor para n.

Por ejemplo, si deseas obtener los primeros 10 números de la sucesión de Fibonacci, puedes utilizar esta función de la siguiente manera:

for i in range(10):
    print(fibonacci(i))

Esto imprimirá en pantalla los valores de la sucesión de Fibonacci desde el 0 hasta el 9. Espero que te sea útil esta función.
